import React from 'react';
// import './FeaturesSection.css';

const FeaturesSection = () => {
    const features = [
        { title: 'Secure Transactions', description: 'Advanced encryption to protect your financial data.' },
        { title: 'Fast Transfers', description: 'Instant money transfers with zero delays.' },
        { title: 'Smart Savings', description: 'Automated savings plans tailored to your goals.' },
    ];

    return (
        <section className="features-section">
            <h2>Our Features</h2>
            <div className="features-grid">
                {features.map((feature, index) => (
                    <div key={index} className="feature-card">
                        <h3>{feature.title}</h3>
                        <p>{feature.description}</p>
                    </div>
                ))}
            </div>
        </section>
    );
};

export default FeaturesSection;
